const Header = (props) => {
  return (
    <div>
        <h1>
        {props.course}
      </h1>
    </div>
  )
}
const Content = (props) => {
  return (
    <div>
        <p>
        {props.content[0]}
        </p>
        <p>
        {props.content[1]}
        </p>
        <p>
        {props.content[2]}
        </p>

    </div>
  )
}
const Total = (props) => {
  return (
    <div>
        <p>Number of exercises {props.excercises[0]+ props.excercises[1]+ props.excercises[2]}</p>
    </div>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14
  const partArray = [part1, part2, part3]
  const excerciseArray= [excercises1, excercises2, excercises3]

  return (
    <div>
        <Header course={course}/>
        <Content content={partArray} />

      <Total excercises={excerciseArray}/>
    </div>
  )
}

export default App
